import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import { BrowserRouter } from "react-router-dom";
import './index.css';


ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <App className="wrapper"/>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);
